import Header from '../components/organism/Header'
import {useParams} from "react-router-dom";


function Detail() {
    let idArticle = useParams();
    return (
        <div>
            <Header className="w-full"/>
            <h1>Detail plante</h1>
            <h2>Plante id : {idArticle.name}</h2>
        </div>
    )
}
export default Detail;
